// Home page
import React from "react";
import { Link } from 'react-router-dom';
import Patient from './pages/Patient.js'
import Login from './pages/Login.js'
//import { useEffect, useState } from "react";

function Home() {
  return (
    <div className='Home'>
      <h2>Welcome to Progenics!</h2>
      <h6>Please navigate below</h6>
      <link to='/login'>
      </link>
      <button className='HomeButtons'>Login</button> <button className='HomeButtons'>Submit registration form</button>
    </div>
  );
}

export default Home;
